Semplicemente, è accorgersi delle cose prima che capitino a te”.

A CARATTERI CUBITALI.

@Risorgiamo Magari ci fosse ancora l'immunità parlamentare. Il Parlamento sarebbe più indipendente e libero. 
Rimane solo l'insindacabilità dei voti e delle opinioni e l'impossibilità di arresto senza autorizzazione della Camera. 
